    result = set()
    i = 0
    while (1 << i) <= 4 * n:
        for j in range(i - 1):
            if (1 << i) - 1 - (1 << j) <= n:
                result.add((1 << i) - 1 - (1 << j))
        i += 1
    return len(result)


